//import Click form Click
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Switch>
        <Route path="/product" conponent={ProductList}/>
        <Route exact path="/" conponent={Main}/>
      </Switch>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

